description:
Verenigde Staten
Drama / Thriller
92 minuten

goed

met Greg Kinnear, James Caviezel en Joe Pantoliano

Vijf mannen ontwaken in een pakhuis voor chemische artikelen, beseffend dat zij zelf niet meer weten wie ze zijn noch weten hoe 
zij daar gekomen zijn. Allengs beginnen zij zich gewaar te worden van het feit dat sommigen van hen kidnappers zijn en de 
anderen de gijzelaars. De tijd dringt om uit te zoeken wie nu precies wie is, daar de leider van de kidnappers-bende zich op weg 
bevindt naar het pakhuis met als doel de gijzelaars te doden.
